  \"2015-04-25T06:19:35.156156\",\n\t\"name\": \"permafrost-soils-database-for-northern-alaska-2014\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This database contains soil and permafrost
  stratigraphy for northern Alaska compiled from numerous project data files and reports.
  The Access Database has main data tables (tbl_) for site (environmental), soil stratigraphy,
  soil physical data, soil chemical data, soil radiocarbon dates, and vegetation cover.
  The Site data includes information of location, observers, geomorphology, topography,
  hydrology, soil summary characteristics, pH and EC, soil classification, and vegetation
  cover by species. Soil stratigraphy has information on soil texture and ground ice.
  Soil physical and chemical data includes lab data on bulk density, moisture, carbon,
  and nitrogen. The database has 38 reference tables (REF_) that have codes and descriptions
  for variables used in site, soil stratigraphy, and vegetation cover tables. Query
  tables (qry_) are used to link data tables and reference tables to display data
  with names instead of codes.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
